    <style type=3D"text/css">
        a { text-decoration: none; color: #0088CC; }
        a:hover { text-decoration: underline }

        /*Body style for Outlook 2010*/
        body {
            font-size: 18px;
            width: 100% !important;
            background-color: white;
            margin: 0;
            padding: 0;
            font-family: 'Helvetica Neue', 'Arial', 'Helvetica', 'Verdana',=
 sans-serif;
            color: #333333;
            line-height: 26px;
        }

        @media only screen and (-webkit-min-device-pixel-ratio:1.5), only s=
creen and (min-device-pixel-ratio:1.5) {

            img { visibility:hidden }
            *[class=3Dmore], *[class~=3Daapl-link] img { visibility:visible=
 !important;}
            *[class=3Dlogo] {
                background:url('https://www.apple.com/support/images/emails=
/2016/apple-2x-large.png') no-repeat 0 0;
                -webkit-background-size: 36px auto;
                max-width: 36px;
                height: auto;
                background-position: top left;
                display: block;
            }
        }

        /*PHONE STYLES - For clients that support media queries (copied fro=
m previous templates)*/
        @media only screen and (max-width:735px)  {

            .top-padding { line-height:60px !important } /*padding or heigh=
t do not work on Outlook, must use line-height*/
            td[class=3D"emailcontent"] {
                padding-left: 15px !important;
                padding-right: 15px !important;
                padding-bottom:44px !important;
            }
            table {
                width: 100%!important;
                padding:0;
            }
            #transcript {
                padding-left: 15px !important;
                padding-right: 15px !important;
                padding-top: 36px !important;
                padding-bottom: 36px !important;
            }
            /* Not used
                table[class=3D'responsive'],
                table[class=3D'responsive'] tbody,
                table[class=3D'responsive'] tr,
                table[class=3D'responsive'] td {display:block}
                td img {max-width:100%!important; height:auto!important} */
            td[class=3D'footer'] {
                -webkit-text-size-adjust: 100% !important
            }
            .heading {
                font-size: 32px !important;
                line-height: 36px !important;
                font-weight: 200;
                padding: 20px 0px 34px 0px !important;
                margin: 0;
                border: 0;
                display: block;
            }
            .footer {
                padding: 34px 15px 34px 15px !important;
                text-align: center;
            }
          .logo > img {
              width: 30px !important;
          }
          /*
          *[class=3Dlogo] {
                background:url('https://www.apple.com/support/images/emails=
/2016/apple-1x-small.png') no-repeat 0 0;
                -webkit-background-size: 30px auto;
                max-width:30px;
                height:auto;
                background-position:top left;
                display: block;
